This is a second try, fixing the error I made when I uploaded Dave Chappelle instead of Dave Attell (both are HBO Half Hour Comedy Specials, sorry about that)

Dave Attell (born January 18, 1965) is an American stand-up comedian, writer and actor, best known as the host of Comedy Central's Insomniac with Dave Attell and The Gong Show with Dave Attell. Born in Queens, New York, he grew up in Rockville Centre, New York and now lives in New York City.


Genres:	Blue comedy, Insult comedy, Black comedy


Subject he explore in his routine:
American culture  -  Everyday life  -  Race relations  -  Recreational drug use
Self-deprecation  -  Current events  -  Religion


Influences:	Richard Pryor, Bill Hicks, Sam Kinison, Redd Foxx, Don Rickles

Long time I don't upload a torrent.  So, let's pray these trackers work.  Hope y'all enjoy it like I did.  

